@MainActor func transient_ProjectRoot_sheetIndexes (
       _ self_mSheets : [ObjectIndexProtocol]
) -> IntArray {
//--- START OF USER ZONE 2
        var result = [Int] ()
        for sheet in self_mSheets {
          result.append (sheet.objectIndex)
        }
        return result
